svg.script:

      function changeColor(event) {
        const star = event.target;

const ratings=["","Economize l'energie" , "Utiliser Le Transport public " , "Planter des arbres ! "]
               const starId = parseInt(star.getAttribute('id').replace('star', ''));
               const rt1 = document.querySelectorAll('.an1');
                const rt2 = document.querySelectorAll('.an2')[0];
               const rt4 = document.querySelectorAll('.an8')[0];
                  const rt3 = document.querySelectorAll('.an3')[0];
                    const rt8= document.querySelectorAll('.yy')[0];




        if (star.getAttribute('fill') == '#BCA37F') {
       if(starId==1){
 rt3.textContent =ratings[1 ];
       }
        if(starId==2){
 rt3.textContent =ratings[1 ]+ " , " + ratings[2 ];
       }
        if(starId==3){
 rt3.textContent =ratings[1 ]+ " , " + ratings[2 ]+ " , "+ratings[3 ];
       }
        rt1.forEach((text, index) => {
          const animationDuration = (6-starId) * 0.6; // Adjust the duration as needed
          text.style.animation = `textAnimate ${animationDuration}s infinite alternate`;

        });



          for (let i = 1; i <= starId; i++) {
            const currentStar = document.getElementById('star' + i);
            currentStar.setAttribute('fill', 'gold');
           currentStar.setAttribute('stroke', '#BCA37F');
           currentStar.style.animation=`textAnimate ${0.3}s infinite alternate`;


            if(i==3){
              rt8.style.display='none';
               rt2.style.display='none';
            rt4.style.display='inline';
           }

          }

          }



        else{
         if(starId==3){
              rt4.style.display='none';
               rt2.style.display='inline';
            rt8.style.display='inline';}
            if(starId==2){
              rt4.style.display='none';
               rt2.style.display='inline';
            rt8.style.display='inline';}
            if(starId==1){
              rt4.style.display='none';
               rt2.style.display='inline';
            rt8.style.display='inline';}
             rt3.textContent=ratings[starId-1];
            rt1.forEach((text, index) => {

          const animationDuration = (starId-1) * 0.9; // Adjust the duration as needed
          text.style.animation = `textAnimate ${animationDuration}s infinite alternate`;
        });


          for (let i =3; i >= starId; i--) {
            const currentStar = document.getElementById('star' + i);
            currentStar.setAttribute('fill', '#BCA37F');
            currentStar.setAttribute('stroke', '#113946');
            currentStar.style.animation=`textAnimate ${0}s infinite alternate`;

             rt3.textContent=ratings[i-1];

          }
        }
      }
